class FilterPlugin(Plugin):
    """
    HTTPS 流量处理插件
    """

    def hex_to_len(self, data):
        """
        HEX(16进制) 转数值(10进制)
        """
        try:
            return int(data, 16)
        except:
            return 0

    def pasrse_validity(self, data):
        times = ['', '']

        for i in range(2):
            if data[:2] != '17':
                break
            st_len = self.hex_to_len(data[2: 4])
            if st_len <= 0:
                break
        
            try:
                t = str(bytes.fromhex(data[4: 4 + st_len * 2]), 'gbk', 'ignore')[:-1]
                times[i] = datetime.strftime(datetime.strptime('20' + t, '%Y%m%d%H%M%S'), '%Y-%m-%dT%H:%M:%SZ')
            except:
                break

            data = data[4 + st_len * 2: ]
        
        return {'from': times[0], 'to': times[1]}

    def parse_subject(self, data):
        # 0x0603550403 2.5.4.3  CN commonName                通用名称
        # 0x0603550406 2.5.4.6  C  courtryName               国家简称
        # 0x0603550407 2.5.4.7  L  localityName              城市
        # 0x0603550408 2.5.4.8  S  stateOrProvinceName       省/州
        # 0x060355040a 2.5.4.10 O  organizationName          组织名称
        # 0x060355040b 2.5.4.11 OU organizationUnitName      组织单位
        sub_type_dict = {'03':'CN', '06':'C', '07':'L', '08':'S', '0a':'O', '0b':'OU'}
        cert_info = {}
        while True:
            pos = data.find('06035504')
            if pos == -1:
                break

            sub_type = data[pos + 8: pos + 10]
            var_type = data[pos + 10: pos + 12]
            var_len  = self.hex_to_len(data[pos + 12: pos + 14])
            
            if sub_type in sub_type_dict:
                var = ''
                if var_type == '13': # ANSI
                    var = str(bytes.fromhex(data[pos + 14: pos + 14 + var_len * 2]), 'gbk', 'ignore')
                elif var_type == '0c': # UTF-8
                    var = str(bytes.fromhex(data[pos + 14: pos + 14 + var_len * 2]), 'utf-8', 'ignore')

                if var:
                    cert_info[sub_type_dict[sub_type]] = var

            data = data[pos + 14 + var_len * 2:]

        return cert_info

    def parse_publicKey(self, data):
        """
        获取证书公钥
        """
        pos = data.find('2a864886f70d010101') # 1.2.840.113549.1.1.1 rsaEncryption
        if pos != -1:
            pos = pos + 16 * 2
            if data[pos: pos + 4] == '3082':
                block_len = self.hex_to_len(data[pos + 4: pos + 8])
                return {
                    'algorithm': 'rsaEncryption',
                    'key': data[pos: pos + 8 + block_len * 2]
                }
        else:
            pos = data.find('2a8648ce3d0201') # 1.2.840.10045.2.1 id-ecPublicKey
            if pos != -1:
                data = data[pos + 17 * 2: ]
                if data[: 2] == '03':
                    key_len = self.hex_to_len(data[2: 4])
                    if key_len > 0:
                        return {'algorithm': 'id-ecPublicKey', 'key': data[4: 4 + key_len * 2]}
        
        return {}

    def parse_subject_alt_name(self, data):
        altNames = []

        if data[10: 14] == '0482': # 0603551d11 0428 xxxx 30 ...(xxxx为长度)
            data = data[18: ]
        elif data[10: 12] == '04': # 0603551d11 04 xx 30 ...(xx为长度)
            data = data[14: ]
        else:
            return []
        
        if data.startswith('3082'):
            block_size = self.hex_to_len(data[4: 8])
            data = data[8: 8 + block_size * 2]
        else:
            block_size = self.hex_to_len(data[2: 4])
            data = data[4: 4 + block_size * 2]
        
        while True:
            pos = data.find('82')
            if pos == -1:
                break

            alt_len = self.hex_to_len(data[pos + 2: pos + 4])
            altName = str(bytes.fromhex(data[pos + 4: pos + 4 + alt_len * 2]), 'utf-8', 'ignore')
            if altName:
                altNames.append(altName)

            data = data[pos + 4 + alt_len * 2: ]
        
        return altNames
    
    def parse_cert(self, data):
        # version = data[:2]
        sn_len = self.hex_to_len(data[4: 6])
        serialNumber = ''
        if sn_len > 0:
            serialNumber = data[6: 6 + sn_len * 2]
        
        data = data[6 + sn_len * 2: ]
        cert_info = {
            'validity': {},
            'serialNumber': serialNumber,
            'publicKey': {},
            'CN': '',
            'O': '',
            'L': '',
            'C': '',
            'OU': '',
            'alias': ''
        }

        findedIssuer = False
        while True:
            block_size = 0
            block_pos = 0
            if data.startswith('a382'): # Cert extensions
                block_size = self.hex_to_len(data[4: 8])
                block_pos = 8
            elif data.startswith('30'):
                if data.startswith('3082'):
                    block_size = self.hex_to_len(data[4: 8])
                    block_pos = 8
                elif data.startswith('3081'):
                    block_size = self.hex_to_len(data[4: 6])
                    block_pos = 6
                else:
                    block_size = self.hex_to_len(data[2: 4])
                    block_pos = 4
            else:
                break

            block_data = data[block_pos: block_pos + block_size * 2]
            data = data[block_pos + block_size * 2: ]
            
            if block_data.startswith('17'): # 有效期
                cert_info['validity'] = self.pasrse_validity(block_data)
            
            elif block_data.startswith('30'):
                if block_data[4:6] == '06' and block_data[8:14] == '2a8648':
                    cert_info['publicKey'] = self.parse_publicKey(block_data)
                
                else:
                    pos = block_data.find('0603551d11')
                    if pos > 0:
                        altNames = self.parse_subject_alt_name(block_data[pos: ])
                        cert_info['alias'] = ','.join(altNames)

                    elif block_data.find('06035504') >= 0: # issuer /subject
                        if not findedIssuer: # 跳过 issuer 块，它总是在 subject 前面
                            findedIssuer = True
                        else:
                            subject = self.parse_subject(block_data)
                            cert_info = dict(cert_info, **subject)
            
            elif block_data.startswith('31'): # issuer / subject
                if block_data.find('06035504') > 0:
                    if not findedIssuer: # 跳过 issuer 块，它总是在 subject 前面
                        findedIssuer = True
                    else:
                        subject = self.parse_subject(block_data)
                        cert_info = dict(cert_info, **subject)

        return cert_info

    def fetch_certs(self, data):
        certs = []

        include_chain = False
        if self._config and 'include_chain' in self._config and self._config['include_chain']:
            include_chain = True
        
        pos = 0
        while True:
            # 证书头部
            pos = data.find('3082', pos)
            if pos == -1:
                break

            if data[pos + 8: pos + 16] != 'a0030201':
                pos += 4
                continue

            # 证书长度
            cert_len = self.hex_to_len(data[pos + 4: pos + 8])
            if cert_len <= 0:
                pos += 4
                continue

            cert_raw = data[pos + 8 + 8: pos + 8 + 8 + cert_len * 2]
            cert = self.parse_cert(cert_raw)
            if cert['CN']:
                certs.append(cert)
            
            # 配置为不含证书链时则只处理第一个有效的证书
            if not include_chain and len(cert) > 0:
                break

            pos = pos + 8 + 8 + cert_len * 2

        return certs
    
    def execute(self, msg):
        """
        插件入口函数，根据插件的功能对 msg 进行处理
        :param msg: 需要处理的消息
        :return: 返回需要更新的消息字典（不含原始消息）
        """
        if 'pro' not in msg or msg['pro'] != 'TCP':
            self.log('Not tcp message.', LogLevel.DEBUG)
            return None

        if not msg['data'] or not msg['data'].startswith('1603'): # SSLv3/TLS 固定头部
            self.log('Not ssl/tls message.', LogLevel.DEBUG)
            return None
        
        certs = self.fetch_certs(msg['data'])
        info = {
            'certs': certs
        }

        return info

